#include <netdb.h>
#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <sys/socket.h>
#include <time.h>
#include <sys/time.h>
#include <unistd.h>
#include <arpa/inet.h>
#define MAX 80
#define PORT 8080
#define SA struct sockaddr
struct timeval timeout;
void func(int sockfd, int nf, int ws)
{
    char buff[MAX];
    int ack, i = 0, n, k, w1 = 0, w2 = ws - 1, j, flag = 0, count_ack = 0;
    if (setsockopt(sockfd, SOL_SOCKET, SO_RCVTIMEO, (const char *)&timeout, sizeof(timeout)) < 0)
        perror("setsockopt(SO_RCVTIMEO) failed");
    for (i = 0; i < nf && i <= w2; i++)
    {
        bzero(buff, sizeof(buff));
        snprintf(buff, sizeof(buff), "%d", i);
        k = send(sockfd, buff, sizeof(buff), 0);
        printf("Frame %d sent\n", i);
    }
    while (1)
    {
        if (count_ack == nf)
        {
            strcpy(buff, "Exit");
            k = send(sockfd, buff, sizeof(buff), 0);
            break;
        }
        if (w2 - w1 != ws - 1 && flag == 0 && i != nf)
        {
            bzero(buff, sizeof(buff));
            snprintf(buff, sizeof(buff), "%d", i);
            k = send(sockfd, buff, sizeof(buff), 0);
            printf("Frame %d sent\n", i);
            w2++;
            i++;
        }
        flag = 0;
        bzero(buff, sizeof(buff));
        n = recv(sockfd, buff, MAX, 0);
        ack = atoi(buff);
        if (n > 0)
        {
            if (ack + 1 == nf)
            {
                printf("Acknowledgement received: %d\n", ack);
                count_ack++;
                bzero(buff, sizeof(buff));
                /*strcpy(buff, "Exit");
                k = send(sockfd, buff, sizeof(buff), 0);
                break;*/
            }
            else if (ack == -1)
            {
                printf("Acknowledgement not received for %d\nResending frame\n", w1);
                bzero(buff, sizeof(buff));
                snprintf(buff, sizeof(buff), "%d", w1);
                k = send(sockfd, buff, sizeof(buff), 0);
                printf("Frame sent: %d\n", w1);
            }
            else
            {
                w1++;
                printf("Acknowledgement received: %d\n", ack);
                count_ack++;
            }
        }
    }
}
void main()
{
    int sockfd, connfd, f, w;
    struct sockaddr_in servaddr, cli;
    sockfd = socket(AF_INET, SOCK_STREAM, 0);
    if (sockfd == -1)
    {
        printf("Socket creation failed\n");
        exit(0);
    }
    else
        printf("Socket successfully created\n");
    bzero(&servaddr, sizeof(servaddr));
    servaddr.sin_family = AF_INET;
    servaddr.sin_addr.s_addr = inet_addr("127.0.0.1");
    servaddr.sin_port = htons(PORT);
    timeout.tv_sec = 3;
    timeout.tv_usec = 0;
    if (connect(sockfd, (SA *)&servaddr, sizeof(servaddr)) != 0)
    {
        printf("Connection with the server failed\n");
        exit(0);
    }
    else
        printf("Connected to the server\n");
    printf("Enter the number of frames: ");
    scanf("%d", &f);
    printf("Enter the window size: ");
    scanf("%d", &w);
    func(sockfd, f, w);
    close(sockfd);
}

#include <stdio.h>
#include <netdb.h>
#include <netinet/in.h>
#include <stdlib.h>
#include <string.h>
#include <sys/socket.h>
#include <sys/types.h>
#include <sys/time.h>
#include <unistd.h>
#define MAX 80
#define PORT 8080
#define SA struct sockaddr
struct timeval timeout;
void func(int connfd)
{
    char buff[MAX];
    int f, c, ack, next = 0;
    while (1)
    {
        sleep(1);
        bzero(buff, MAX);
        recv(connfd, buff, MAX, 0);
        if (strcmp("Exit", buff) == 0)
        {
            printf("Exit\n");
            break;
        }
        f = atoi(buff);
        c = rand() % 3;
        switch (c)
        {
        case 0:
            printf("Frame %d not received\n", f);
            ack = -1;
            printf("Negative Acknowledgement sent: %d\n", f);
            bzero(buff, MAX);
            snprintf(buff, sizeof(buff), "%d", ack);
            send(connfd, buff, sizeof(buff), 0);
            break;
        case 1:
            ack = f;
            sleep(2);
            printf("Frame %d received\nAcknowledgement sent: %d\n", f, ack);
            bzero(buff, MAX);
            snprintf(buff, sizeof(buff), "%d", ack);
            send(connfd, buff, sizeof(buff), 0);
            next = ack + 1;
            break;
        case 2:
            ack = f;
            printf("Frame %d received\nAcknowledgement sent: %d\n", f, ack);
            bzero(buff, MAX);
            snprintf(buff, sizeof(buff), "%d", ack);
            send(connfd, buff, sizeof(buff), 0);
            next = ack + 1;
            break;
        }
    }
}
void main()
{
    int sockfd, connfd, len;
    struct sockaddr_in servaddr, cli;
    sockfd = socket(AF_INET, SOCK_STREAM, 0);
    if (sockfd == -1)
    {
        printf("Socket creation failed\n");
        exit(0);
    }
    else
        printf("Socket successfully created\n");
    bzero(&servaddr, sizeof(servaddr));
    servaddr.sin_family = AF_INET;
    servaddr.sin_addr.s_addr = htonl(INADDR_ANY);
    servaddr.sin_port = htons(PORT);
    if ((bind(sockfd, (SA *)&servaddr, sizeof(servaddr))) != 0)
    {
        printf("socket bind failed\n");
        exit(0);
    }
    else
        printf("Socket successfully binded\n");
    if ((listen(sockfd, 5)) != 0)
    {
        printf("Listen failed\n");
        exit(0);
    }
    else
        printf("Server listening\n");
    len = sizeof(cli);
    connfd = accept(sockfd, (SA *)&cli, &len);
    if (connfd < 0)
    {
        printf("Server accept failed\n");
        exit(0);
    }
    else
        printf("Server accept the client\n");
    func(connfd);
    close(sockfd);
}

