                             strcpy(buffer,"kca");
                             printf("Ack lost\n");
                             for(p=1;p<=3;p++)
                             {
                                printf("Waiting for %d seconds\n",p);
                             }
                             printf("Retransmitting ack...\n");
                             strcpy(buffer,"ack");
                             sleep(3);
