@Mixin(ItemEntity.class)
public class ItemPickUpMixin{
    @Inject(at = @At("HEAD"), method = "onPlayerCollision", cancellable=true)
    private void onPlayerCollision(PlayerEntity player, CallbackInfo info) {
        if (player instanceof NewPlayerEntity) {
            ItemEntity itemEntity = (ItemEntity) (Object) this;
            ItemStack itemStack = itemEntity.getStack();

            if (itemStack.isEmpty()) return;

            try {
                NewPlayerEntity customPlayer = (NewPlayerEntity) player;
                StellarPlayerEntity stellarPlayerEntity = customPlayer.getStellarPlayerEntity();
                ModularInventory modularInventory = stellarPlayerEntity.getModularInventory();
                player.sendMessage(Text.of("–ü—ã—Ç–∞—é—Å—å –¥–æ–±–∞–≤–∏—Ç—å " + itemStack.getCount() + " " + itemStack.getItem().getName().getString()), false);

                int count = itemStack.getCount();
                boolean added = modularInventory.addItem(itemStack.copy()); // –í–∞–∂–Ω–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –∫–æ–ø–∏—é!

                if (added) {
                    player.sendMessage(Text.of("–ü—Ä–µ–¥–º–µ—Ç –¥–æ–±–∞–≤–ª–µ–Ω –≤ –º–æ–¥—É–ª—å–Ω—ã–π –∏–Ω–≤–µ–Ω—Ç–∞—Ä—å"), false);
                    player.sendPickup(itemEntity, count);
                    player.increaseStat(Stats.PICKED_UP.getOrCreateStat(itemStack.getItem()), count);

                    itemEntity.discard();
                    info.cancel();
                } else {
                    player.sendMessage(Text.of("–ù–µ —É–¥–∞–ª–æ—Å—å –¥–æ–±–∞–≤–∏—Ç—å –ø—Ä–µ–¥–º–µ—Ç –≤ –º–æ–¥—É–ª—å–Ω—ã–π –∏–Ω–≤–µ–Ω—Ç–∞—Ä—å"), false);
                }
            } catch (Exception e) {
                player.sendMessage(Text.of("–û—à–∏–±–∫–∞: " + e.getMessage()), false);
            }
        }
    }
}

#include <iostream>
#include <vector>
using namespace std;
typedef long long ll;
const ll INF = 1e18;
int main() {
    ll k, x;
    cin >> k >> x;
    
    ll power = 1;
    ll res = INF;
    
    for(int i = 0; i < 100; i++) {
        ll tmp = power * k;
        if(tmp <= x) {
            if(x % tmp == 0) {
                ll quotient = x / tmp;
                if(quotient * k * power == x) {
                    res = min(res, i + quotient);
                }
            }
        }
        else {
            break;
        }
        power *= k;
    }
    if(res == INF) {
        res = -1;
    }
    cout << res << endl;
    
    return 0;
}

#include <iostream>
